import React from "react";
import styled from "styled-components";
import theme from "../../Logic/theme";

const { primary, secondary, tri, quad, background, primaryFont } = theme;

const Container = styled.div`
  grid-area: misc;
  width: 100%;
`;

const MiscStats = () => {
  return <Container>I am misc constainer</Container>;
};

export default MiscStats;
